INSERT INTO `policies` (`id`, `name`, `content`, `created_at`, `updated_at`) VALUES
(1, 'support_policy', '<p><span style=\"font-size: small;\"><strong style=\"font-size: 20px;\">To buy online from joestore.com.bd, please follow the procedures-</strong></span></p>\r\n<ol style=\"font-size: medium; line-height: 27px;\">\r\n<li>Firstly, go to your web browser and type in <strong>joestore.com.bd</strong> to visit Joestores\'s&nbsp;website.</li>\r\n<li>If you are a registered user of Joestore, then click on <strong>SIGN IN</strong> and type in your email address and password to <strong>LOG IN</strong>. If you are not a a registered user of Bagdoom, then click on <strong>REGISTER</strong> and fill in your name, email ID, address, phone number and all other required information and submit it.</li>\r\n<li>To go through product categories, go to Joestore’s home page and \r\nclick on the different category banners set out on the home page. You \r\nwill also find other category tabs above with listed products of your \r\nselected category.</li>\r\n<li>If you prefer an item, click on it. To have a closer look, place \r\nyour cursor on the image of the selected product to zoom into it. Click \r\non SIZE CHART to match your product size (if any) to your preferred \r\nsize.</li>\r\n<li>Click on PRODUCT DESCRIPTION tab below to read through the \r\ndescription of the selected product. Click on PRODUCT CONDITION to know \r\nall the conditions applicable.</li>\r\n<li>After selecting your preferred size, fill in your preferred quantity/number of the product and click on <strong>BUY NOW</strong>.</li>\r\n<li>You will see your product listed on the new window that will open \r\nup. To buy more products, click on CONTINUE SHOPPING and follow the \r\nprevious steps to select products to add to your shopping cart. Your \r\nproduct can be seen listed when you click on the CART ICON above.</li>\r\n<li>If you wish to conclude your shopping here today, click on PROCEED TO PAYMENT to go to the payment page.</li>\r\n<li>If you are logged in, then your information will be automatically \r\nfilled in; if not, then log in using your email ID and password.</li>\r\n<li>Select your mode of delivery and payment.</li>\r\n<li>Please review and check your order and click on PLACE ORDER to confirm.</li>\r\n<li>When your order is confirmed on the next page, please keep your order number noted.</li>\r\n<li>Happy browsing and shopping through Joestore!</li>\r\n</ol>', '2020-01-09 05:05:06', '2020-01-09 10:05:06'),
(2, 'return_policy', '<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; text-decoration: underline;\"><span style=\"margin: 0px; padding: 0px; font-size: 20px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Return/Replacement Policy</strong></span></span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Joestore’s 7 Days Easy Return Guarantee</strong></span></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">Easy Returns if not satisfied with Products quality, size.</li><li style=\"margin: 0px; padding: 0px;\">100% Money Back if Return/Refund issue not resolved in maximum 7 days</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *For credit card payment return may take longer depending on Commercial Banks</p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">You have to notify us within 24 hours after receiving the Products from the delivery man</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\">joestore.com.bd appreciates every single time you trust us with your purchase. We want you to have an absolutely hassle-free shopping experience. We assure you that all Products sold on joestore.com.bd are brand new. In case the Products you have received is \'Damaged\', \'Defective\' or \'Not as Described\', you can return it within 7 days and we will solve your problem within 5 days (Outside Dhaka 10 days), after receiving your notification. You can have Replacement or Refund.</p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Return can be occurred in two stages:</strong></span></p><ol style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside decimal; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">At the time of delivery</li><li style=\"margin: 0px; padding: 0px;\">After receiving a delivery (Have to notify within 24 hrs)</li></ol><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">You can return the Products if:</strong></span></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">You received a defective Product</li><li style=\"margin: 0px; padding: 0px;\">You received a physically damaged Product</li><li style=\"margin: 0px; padding: 0px;\">You are unhappy with the Products quality</li><li style=\"margin: 0px; padding: 0px;\">The Product is different from description on the website</li><li style=\"margin: 0px; padding: 0px;\">Size or Fit issue</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">All items which can be resold are always eligible for return. Except the following</strong></span></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">Items that have been worn or washed</li><li style=\"margin: 0px; padding: 0px;\">Products which were sold as combos or in sets, are not eligible for return/replacement as individual items</li><li style=\"margin: 0px; padding: 0px;\">Products should not be used.</li><li style=\"margin: 0px; padding: 0px;\">Products must be in their original condition</li><li style=\"margin: 0px; padding: 0px;\">Items should be unused, unaltered, unsoiled Products with their original tags</li><li style=\"margin: 0px; padding: 0px;\">Item must be in the original packaging, in the original condition</li><li style=\"margin: 0px; padding: 0px;\">Seal open branded electronic items cannot be returned in case of not being happy with the Products as they can’t be resold. Except if the Products is damaged or not working from the start</li><li style=\"margin: 0px; padding: 0px;\">In case of branded electronic items, brands’ &nbsp;or e-store merchants return, repair and replacement policy will apply</li><li style=\"margin: 0px; padding: 0px;\">For non branded electronic Products please see the Products condition. On Products details section &nbsp;</li><li style=\"margin: 0px; padding: 0px;\">You need to check all non branded electronic Products when you receive the Products form delivery man (within 24 hour notification is not applicable for non branded electronic Products)</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">The customer must ensure the item is packed and delivered securely. joestore.com.bd will not be held responsible if the goods get damaged on their return to joestore.com.bd office.&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-size: medium;\">Returns are easy, simply follow these steps</span></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px;\">With Order ID details and problem e-mail us at<span>&nbsp;</span><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">info@joestore.com.bd</strong><span>&nbsp;</span>within 24 hour</span></li><li style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px;\">We will confirm the return request and will inform you about the pickup process.</span></li><li style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px;\">Please ensure that Products is in unused and original condition. Include all price tags, labels, original packing and invoice along with the Products.</span></li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 15px;\">Please note that you need to contact us within 24 hours after receiving a faulty or damaged Products, it is very necessary that you contact us via mail and also you have to send us the Products within 7 days. We will bear the return delivery charge.</span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Refund Policy</strong></span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">joestore.com.bd provides the most hassle-free online shopping experience. Your money is safe with us. Refunds are issued when</span></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">If seller cannot provide replacement</li><li style=\"margin: 0px; padding: 0px;\">After return if you want your money back</li><li style=\"margin: 0px; padding: 0px;\">If a different Products is delivered to you.</li><li style=\"margin: 0px; padding: 0px;\">If you changes mind &amp; can cancel booking before the Products is already shipped</li><li style=\"margin: 0px; padding: 0px;\">If you don’t want replacement.</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">- Most refunds are fully refunded in 7 days after we receive and process your return.</span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">- If you pay us by using card then we will request a refund in bank which will take 7-10 working days.(&nbsp;credit card payment return may take longer depending on Commercial Banks)</span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">- If you pay us by bkash then your money will be bkashed in your desired account within<span>&nbsp;</span><span style=\"margin: 0px; padding: 0px;\">2-5 working days</span>.</span></p><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\"><span style=\"margin: 0px; padding: 0px; font-size: 15px;\">Refund are easy, simply follow these steps</span></strong></p><ul style=\"margin: 0px 0px 1em; padding: 0px 0px 0px 1.5em; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 15px;\"><li style=\"margin: 0px; padding: 0px;\">Provide us with Order ID details and&nbsp;e-mail : info@joestore.com.bd</li><li style=\"margin: 0px; padding: 0px;\">We will confirm the Refund request and will inform you about the process.</li></ul><p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(47, 47, 47); font-family: robotoregular; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 15px;\">Please note that if we send you faulty Products then we will bear the delivery charge and transaction cost for credit card.</span></p>', '2020-01-09 05:06:20', '2020-01-09 10:06:20'),
