(6, 'privacy_policy', '<h3 style=\"margin: 0px 0px 15px; padding: 0px; line-height: 1.35; color: rgb(77, 134, 198); font-weight: bold; font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 18px;\"><span style=\"font-family: Arial, Helvetica, sans-serif;\"><u style=\"\"></u><u style=\"\">Privacy Policy:\r\n    \r\n    </u><u style=\"\"></u></span>\r\n</h3>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">This Privacy Statement (<strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">“Privacy Statement”</strong>) clarifies how joestore.com.bd&nbsp;uses personal information.</span></p>\r\n<span style=\"margin: 0px; padding: 0px; color: rgb(47, 47, 47); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: medium;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 15px;\">1. Types of Personal Information We Collect</strong></span>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Personal Information is information that can be used to identify, locate, or contact an individual.It also includes other information that may be associated with Personal Information. We collect the following types of Personal Information:</span></p>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Contact Information</strong><span>&nbsp;</span>that allows us to communicate with you,\r\n    such as your name, postal addresses, email addresses, social media website user account names, telephone numbers, or other addresses at which you receive communications from or on behalf of joestore.com.</span></p>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Transaction Information</strong><span>&nbsp;</span>about how you purchase and redeem.\r\n    </span>\r\n</p>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold;\">Financial Account Information</strong><span>&nbsp;</span>as needed to process payments\r\n    for joestore.com&nbsp;that you buy, such as your credit or debit card number, expiration date.</span>\r\n</p><span style=\"margin: 0px; padding: 0px; color: rgb(47, 47, 47); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: medium;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 15px;\">2. How joestore.com&nbsp;Collects Personal Information?</strong></span>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">We ask you for Personal Information when you register, subscribe, create an account, order a deal, or otherwise interact with the Sites or contact.</span></p>\r\n<span style=\"margin: 0px; padding: 0px; color: rgb(47, 47, 47); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: medium;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 15px;\">3. How joestore.com&nbsp;Uses Personal Information?</strong></span>\r\n<ul style=\"margin: 0px 0px 1em; padding: 10px 0px 10px 30px; list-style: outside disc; color: rgb(47, 47, 47); font-family: robotoregular; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 12px;\">\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Operate and improve our Sites.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Provide customers with offers for products and services.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Process orders, including purchase and redemption.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Track redemption of order and perform other analytics.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Provide customer support, including to our merchants or business partners.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Fulfill requests for services.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Communicate and provide additional information that may be of interest to you, such as news, special offers and coupons, announcements, and marketing materials.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Send you reminders, technical notices, updates, security alerts and support and administrative messages service bulletins&nbsp;or marketing sms.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Provide advertisements to you through the Sites, email messages, text messages, applications, or other methods of communication.</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Administer surveys, sweepstakes, contests, or other promotional activities or events sponsored by us or our partners</span></li>\r\n    <li style=\"margin: 0px; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">Allow you to apply for a job, post a video or sign up for special offers from third parties through the Site.</span></li>\r\n</ul><span style=\"margin: 0px; padding: 0px; color: rgb(47, 47, 47); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: medium;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 15px;\">4. When joestore.com&nbsp;Discloses Personal Information?</strong></span>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">We will not disclose your Personal Information to third parties ever.</span></p><span style=\"margin: 0px; padding: 0px; color: rgb(47, 47, 47); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: medium;\"><strong style=\"margin: 0px; padding: 0px; font-weight: bold; font-size: 15px;\">5. Accessing and Correcting Personal Information</strong></span>\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(65, 64, 66); font-family: robotolight; text-align: justify; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; font-size: medium; font-family: Arial, Helvetica, sans-serif;\">You may correct your information by signing in your account. Or you may also email to info@joestore.com. If you want to close your account or have other questions or requests, please contact us: +88 01716997125</span></p>', '2020-01-09 05:08:47', '2020-01-09 10:08:47'),
(7, 'how_to_buy', '<p><span style=\"font-size: small;\"><strong style=\"font-size: 20px;\">To buy online from www.joestore.com.bd, please follow the procedures-</strong></span></p>\r\n<ol style=\"font-size: medium; line-height: 27px;\">\r\n<li>Firstly, go to your web browser and type in <strong>www.joestore.com.bd</strong>&nbsp;to visit joestore’s website.</li>\r\n<li>If you are a registered user of JOESTORE, then click on <strong>SIGN IN</strong> and type in your email address and password to <strong>LOG IN</strong>. If you are not a a registered user of JOESTORE, then click on <strong>REGISTER</strong> and fill in your name, email ID, address, phone number and all other required information and submit it.</li>\r\n<li>To go through product categories, go to Joestore’s home page and \r\nclick on the different category banners set out on the home page. You \r\nwill also find other category tabs above with listed products of your \r\nselected category.</li>\r\n<li>If you prefer an item, click on it. To have a closer look, place \r\nyour cursor on the image of the selected product to zoom into it. Click \r\non SIZE CHART to match your product size (if any) to your preferred \r\nsize.</li>\r\n<li>Click on PRODUCT DESCRIPTION tab below to read through the \r\ndescription of the selected product. Click on PRODUCT CONDITION to know \r\nall the conditions applicable.</li>\r\n<li>After selecting your preferred size, fill in your preferred quantity/number of the product and click on <strong>BUY NOW</strong>.</li>\r\n<li>You will see your product listed on the new window that will open \r\nup. To buy more products, click on CONTINUE SHOPPING and follow the \r\nprevious steps to select products to add to your shopping cart. Your \r\nproduct can be seen listed when you click on the CART ICON above.</li>\r\n<li>If you wish to conclude your shopping here today, click on PROCEED TO PAYMENT to go to the payment page.</li>\r\n<li>If you are logged in, then your information will be automatically \r\nfilled in; if not, then log in using your email ID and password.</li>\r\n<li>Select your mode of delivery and payment.</li>\r\n<li>Please review and check your order and click on PLACE ORDER to confirm.</li>\r\n<li>When your order is confirmed on the next page, please keep your order number noted.</li>\r\n<li>Happy browsing and shopping through Joestore!</li>\r\n</ol>', '2020-01-06 07:41:17', '2020-01-06 12:41:17'),
(8, 'cash_on_delivery', '<p><strong style=\"font-size: 18px;\">Cash on Delivery is available in the Following Metropolitan Cities:</strong></p>\r\n<ul style=\"font-size: 16px;\">\r\n<li>Dhaka</li>\r\n<li>Sylhet</li>\r\n<li>Chittagong</li>\r\n<li>Khulna</li>\r\n<li>Bogra</li>\r\n<li>Comilla</li>\r\n<li>Rajshahi</li>\r\n</ul>\r\n<p><span style=\"font-size: 14px; color: #ff0000;\">*** Only the areas under the Metropolitan City</span></p>\r\n<div>\r\n<p>&nbsp;<strong style=\"font-size: 18px;\">Delivery time:</strong></p>\r\n<ul style=\"font-size: 16px;\">\r\n<li>In Dhaka the product delivery takes 3-5 working days, customers \r\ninside Dhaka can also avail Same day delivery service if they are under \r\nthe Same Day Delivery area. Note: Delivery time will be start after \r\ndispatch from joestore.com.bd warehourse.</li>\r\n<li>In case of outside Dhaka 5-8 Workings days is required for proper \r\ndelivery of the product. It may vary due to Political/Natural \r\ndisturbances in the country. Note: Delivery time will be start after \r\ndispatch from joestore.com.bd warehourse.</li>\r\n<li>As joestore.com.bd&nbsp;rely on third-party logistics partners and vendors \r\nfor product delivery issue. Therefore, joestore.com.bd&nbsp;has limited control \r\non due time delivery. For any query please contact us at our hotline \r\nnumber is 01516 154952&nbsp;(Everyday 11&nbsp;am to 10&nbsp;am) or e-mail us at \r\ninfo@joestore.com.bd</li>\r\n</ul>\r\n<p><strong><span style=\"font-size: 18px;\">If outside the Cash on Delivery areas then Customer needs to pay in Advance by the following methods:</span></strong></p>\r\n<ul style=\"font-size: 16px;\">\r\n<li>bKash/rocket</li>\r\n<li>Sure Cash</li>\r\n<li>Credit/Debit Card</li>\r\n<li>Bank Deposit</li>\r\n</ul>\r\n<p>&nbsp;<strong style=\"font-size: 18px;\">Return Policy:</strong></p>\r\n<ul style=\"font-size: 16px;\">\r\n<li>Customer can easily return the product to the delivery person when the delivery is being made</li>\r\n<li>In case of electronic gadgets the seal can’t be broken</li>\r\n<li>Customer can also send the product back through courier service to our office address.</li>\r\n</ul>\r\n<div><span style=\"font-size: 16px;\">For more details on return policy, please visit- </span><font size=\"3\">joestore.com.bd</font></div>\r\n<div><span style=\"font-size: 16px;\"><span style=\"font-size: medium;\"><br></span></span></div></div>', '2020-01-17 06:12:08', '2020-01-17 11:12:08'),
(9, 'seller_corner', '<div class=\"std\"><p><span style=\"text-decoration: underline;\"><span style=\"font-size: 20px;\"><strong>Return/Replacement Policy</strong></span></span></p>\r\n<p><span style=\"font-size: 15px;\"><strong>Bagdoom’s 7 Days Easy Return Guarantee </strong></span></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>Easy Returns if not satisfied with Products quality, size.</li>\r\n<li>100% Money Back if Return/Refund issue not resolved in maximum 7 days</li>\r\n</ul>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; *For credit card payment return may take longer depending on Commercial Banks</p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>You have to notify us within 24 hours after receiving the Products from the delivery man</li>\r\n</ul>\r\n<p style=\"font-size: 15px;\">bagdoom.com appreciates every single time \r\nyou trust us with your purchase. We want you to have an absolutely \r\nhassle-free shopping experience. We assure you that all Products sold on\r\n bagdoom.com are brand new. In case the Products you have received is \r\n\'Damaged\', \'Defective\' or \'Not as Described\', you can return it within 7\r\n days and we will solve your problem within 5 days (Outside Dhaka 10 \r\ndays), after receiving your notification. You can have Replacement or \r\nRefund.</p>\r\n<p><span style=\"font-size: 15px;\"><strong>Return can be occurred in two stages:</strong></span></p>\r\n<ol style=\"font-size: 15px;\">\r\n<li>At the time of delivery</li>\r\n<li>After receiving a delivery (Have to notify within 24 hrs)</li>\r\n</ol>\r\n<p><span style=\"font-size: 15px;\"><strong>You can return the Products if:</strong></span></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>You received a defective Product</li>\r\n<li>You received a physically damaged Product</li>\r\n<li>You are unhappy with the Products quality</li>\r\n<li>The Product is different from description on the website</li>\r\n<li>Size or Fit issue</li>\r\n</ul>\r\n<p><span style=\"font-size: 15px;\"><strong>All items which can be resold are always eligible for return. Except the following</strong></span></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>Items that have been worn or washed</li>\r\n<li>Products which were sold as combos or in sets, are not eligible for return/replacement as individual items</li>\r\n<li>Products should not be used.</li>\r\n<li>Products must be in their original condition</li>\r\n<li>Items should be unused, unaltered, unsoiled Products with their original tags</li>\r\n<li>Item must be in the original packaging, in the original condition</li>\r\n<li>Seal open branded electronic items cannot be returned in case of not\r\n being happy with the Products as they can’t be resold. Except if the \r\nProducts is damaged or not working from the start</li>\r\n<li>In case of branded electronic items, brands’ &nbsp;or e-store merchants return, repair and replacement policy will apply</li>\r\n<li>For non branded electronic Products please see the Products condition. On Products details section &nbsp;</li>\r\n<li>You need to check all non branded electronic Products when you \r\nreceive the Products form delivery man (within 24 hour notification is \r\nnot applicable for non branded electronic Products)</li>\r\n</ul>\r\n<p><span style=\"font-size: 15px;\">The customer must ensure the item is \r\npacked and delivered securely. bagdoom.com will not be held responsible \r\nif the goods get damaged on their return to bagdoom.com office.&nbsp;</span><span style=\"font-size: medium;\">Returns are easy, simply follow these steps</span></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li><span>With Order ID details and problem e-mail us at <strong>info@bagdoom.com</strong> within 24 hour</span></li>\r\n<li><span>We will confirm the return request and will inform you about the pickup process.</span></li>\r\n<li><span>Please ensure that Products is in unused and original \r\ncondition. Include all price tags, labels, original packing and invoice \r\nalong with the Products.</span></li>\r\n</ul>\r\n<p><span style=\"color: #ff0000; font-size: 15px;\">Please note that you \r\nneed to contact us within 24 hours after receiving a faulty or damaged \r\nProducts, it is very necessary that you contact us via mail and also you\r\n have to send us the Products within 7 days. We will bear the return \r\ndelivery charge.</span></p>\r\n<p><span style=\"font-size: 15px;\"><strong>Refund Policy </strong></span></p>\r\n<p><span style=\"font-size: 15px;\">bagdoom.com provides the most hassle-free online shopping experience. Your money is safe with us. Refunds are issued when</span></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>If seller cannot provide replacement</li>\r\n<li>After return if you want your money back</li>\r\n<li>If a different Products is delivered to you.</li>\r\n<li>If you changes mind &amp; can cancel booking before the Products is already shipped</li>\r\n<li>If you don’t want replacement.</li>\r\n</ul>\r\n<p><span style=\"font-size: 15px;\">- Most refunds are fully refunded in 7 days after we receive and process your return.</span></p>\r\n<p><span style=\"font-size: 15px;\">- If you pay us by using card then we \r\nwill request a refund in bank which will take 7-10 working days.(&nbsp;credit\r\n card payment return may take longer depending on Commercial Banks)</span></p>\r\n<p><span style=\"font-size: 15px;\">- If you pay us by bkash then your money will be bkashed in your desired account within <span>2-5 working days</span>.</span></p>\r\n<p><strong><span style=\"font-size: 15px;\">Refund are easy, simply follow these steps</span></strong></p>\r\n<ul style=\"font-size: 15px;\">\r\n<li>Provide us with Order ID details and&nbsp;e-mail : info@bagdoom.com</li>\r\n<li>We will confirm the Refund request and will inform you about the process.</li>\r\n</ul>\r\n<p><span style=\"color: #ff0000; font-size: 15px;\">Please note that if we send you faulty Products then we will bear the delivery charge and transaction cost for credit card.</span></p></div><br>', '2020-01-05 21:35:27', '2020-01-05 13:23:17');
